contracts/ExperienceCertificate.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract ExperienceCertificate is ERC721, Ownable {
    struct Certificate {
        string company;
        string employeeName;
        string description;
        uint256 startDate;
        uint256 endDate;
        string previousExperienceLink;
        bool verified;
    }

    Certificate[] public certificates;
    mapping(uint256 => address) private certificateIssuers;

    // Access control roles
    address public admin;
    address public verifier;

    constructor() ERC721("ExperienceCertificate", "EXP") {
        admin = msg.sender;
    }

    // Modifier to restrict access to admin and verifier
    modifier onlyAdminOrVerifier() {
        require(msg.sender == admin || msg.sender == verifier, "Unauthorized");
        _;
    }

    // Modifier for the verifier
    modifier onlyVerifier() {
        require(
            msg.sender == verifier,
            "Only the verifier can call this function"
        );
        _;
    }

    // Events for transparency
    event CertificateIssued(
        address indexed issuer,
        address indexed recipient,
        uint256 tokenId
    );
    event CertificateTransferred(
        address indexed from,
        address indexed to,
        uint256 tokenId
    );
    event CertificateVerified(uint256 tokenId);

    function setVerifier(address _verifier) public onlyOwner {
        verifier = _verifier;
    }

    function issueCertificate(
        address recipient,
        string memory company,
        string memory employeeName,
        string memory description,
        uint256 startDate,
        uint256 endDate,
        string memory previousExperienceLink
    ) public onlyAdminOrVerifier {
        uint256 certificateId = certificates.length;
        certificates.push(
            Certificate(
                company,
                employeeName,
                description,
                startDate,
                endDate,
                previousExperienceLink,
                false
            )
        );
        _mint(recipient, certificateId);
        certificateIssuers[certificateId] = msg.sender;
        emit CertificateIssued(msg.sender, recipient, certificateId);
    }

    function transferCertificate(address to, uint256 tokenId) public {
        require(
            _isApprovedOrOwner(_msgSender(), tokenId),
            "Not approved or not the owner"
        );
        _transfer(_msgSender(), to, tokenId);
        emit CertificateTransferred(_msgSender(), to, tokenId);
    }

    function getCertificate(
        uint256 tokenId
    )
        public
        view
        returns (
            string memory company,
            string memory employeeName,
            string memory description,
            uint256 startDate,
            uint256 endDate,
            string memory previousExperienceLink,
            bool verified,
            address issuer
        )
    {
        require(_exists(tokenId), "Certificate does not exist");
        Certificate storage certificate = certificates[tokenId];
        issuer = certificateIssuers[tokenId];
        return (
            certificate.company,
            certificate.employeeName,
            certificate.description,
            certificate.startDate,
            certificate.endDate,
            certificate.previousExperienceLink,
            certificate.verified,
            issuer
        );
    }

    function verifyCertificate(uint256 tokenId) public onlyVerifier {
        require(_exists(tokenId), "Certificate does not exist");
        certificates[tokenId].verified = true;
        emit CertificateVerified(tokenId);
    }
}

